import './App.css';
import React, { useState } from 'react';
import {Button} from 'react-bootstrap'

function App() {

  const [one, setOne] = useState(true)


  return (
    <div>
        <Button variant="secondary" size="lg">2</Button>
        <Button variant="secondary" size="lg">3</Button>
        <Button variant="secondary" size="lg">4</Button>
        <Button variant="secondary" size="lg">5</Button>
        <Button variant="secondary" size="lg">6</Button>
        <Button variant="secondary" size="lg">7</Button>
        <Button variant="secondary" size="lg">8</Button>
        <Button variant="secondary" size="lg">9</Button>
        <Button variant="secondary" size="lg">10</Button>
        <Button variant="secondary" size="lg">11</Button>
        <Button variant="secondary" size="lg">12</Button>
    </div>
  );
}

export default App;
